  apiKey: "AIzaSyDhl1OvJYnMbTd-QdESrkAm6YhEVDyAeRY",
  authDomain: "x--di-3187c.firebaseapp.com",
  projectId: "x--di-3187c",
  storageBucket: "x--di-3187c.firebasestorage.app",
  messagingSenderId: "590986441838",
  appId: "1:590986441838:web:248bb26eddc00b741e627f",
  measurementId: "G-K2NYKG2ZEH"
};
